	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  236266,"2",13190,5214,1946,
	  "0.10 USD",52.000,NULL,"Splash page has \"entire contents copyright 1945 by Sheriff J. E. Slavin Boys Village Milford Conn.\" Publication date and on sale date from the publication date reported to the U.S. Copyright Office found in the Catalog of Copyright Entries Third Series Volume I Part 2 Numbers 1 and 2 Periodicals 1946-1947. Class B periodical. Copyright registration number B11878. Story content refers to the atom bombs and therefore is a post-war comic book.",
	  NULL,NULL,NULL,NULL,1946,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  236267,"77",13190,5214,1945,
	  "0.10 USD",52.000,NULL,"Indexed from scanned copy at http://digitalcomicmuseum.com No date given in indicia or rest of the comic. However story content refers to scrap paper drives and defeating the Axis powers Germany and Japan making this comic produced at least prior to May 1945. Issue number two refers to the atom bombs and had reported to the U.S. Copyright Office a publication date of February 23 1946 making issue #77 the probable actual first issue. (as reported by Ken Quattro in the Comics History Exchange page on Facebook 27 August 2016).",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
