	  236271,"4",346,2689,1945,
	  "0.10 USD",52.000,"quarterly","There are sparse references to the ongoing war. There are only three references in this issue: 1.) In the opening Wilbur story \"Elmer The Card\" Wilbur's dad complains about shortages of cigars and socks. 2.) In the Wilbur's Trouble Page war bonds and stamps are awarded for the best letters submitted. 3.) In the story \"The Weaker Sex\" Wilbur and a sailor clash when Wilbur's accused of flirting with the sailor's girlfriend.The back-up story entitled \"Catfish Joe\" is a parody of Frank Sinatra (named \"Hank Swoonatra\").",
