	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  239734,"43",70581,2324,1949,
	  "0.15 USD",44.000,"bi-monthly","Note on page 39 of the magazine: \"Beginning with the January issue on sale Dec. 2 the name of this magazine will be \"Girls' Fun and Fashion Magazine\".  This change has been decided upon after months of consideration.  As you know the name used to be Polly Pigtails and then we shortened it to Polly.  We did that because we found that many girls who no longer wore pigtails objected to the name Polly Pigtails.  But we found also that Polly suggested to many readers that it was exclusively a comic magazine--which of course it isn't.  This is an all-around magazine for girls dealing with their every interest...\"",
	  NULL,NULL,NULL,NULL,NULL,NULL
