	  242127,"1",13513,NULL,1976,
	  "0.30 USD",36.000,"Bi-Monthly","Some covers are signed 'G Lemoine' or 'G. LeMoine' and Gus Lemoine is an established African-American comic artist. The interior artwork is all in the same style and I felt it safe to assume he was responsible. He's credited with the artwork in assorted blogs and webpages that I would take as informed if not gospel. These sites also credit Bertram Fitzgerald as writing the strips. This isn't as clear cut. He is the publisher and has writing credits elsewhere but I've not found anywhere I'd consider definitive on this.",
